import './App.css';
import { ThemeProvider, createTheme } from '@material-ui/core/styles';
import { blue } from '@material-ui/core/colors';
import Banner from './Banner'
import NavBar from './NavBar';
import { Route, Routes } from 'react-router-dom';
import { Box } from '@material-ui/core';

const theme = createTheme({
  palette: {
    primary: {
      main: '#2566a6',
      contrastText: '#ececec',
    },
    secondary: {
      main: '#ececec'
    },
    sheet: {
      main: '#fff',
      contrastText: '#0c1a28',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div style={{backgroundColor:'#e6f6fc'}}>
        <Banner />
        <NavBar />
        <Box
          bgcolor='sheet.main'
          style={{
            position: 'relative',
            top: 10,
            margin: 'auto',
            width: '800px',
            border: '2px solid black'
          }}
        >
          <p>Hello</p>
        </Box>
        {/* <Routes>
          <Route/>
        </Routes> */}
      </div>
    </ThemeProvider>
  );
}

export default App;
